def vector(lon,lat):
    return [r*mt.cos(mt.pi*lat/180)*mt.cos((360+lon)*mt.pi/180),r*mt.cos(mt.pi*lat/180)*mt.sin((360+lon)*mt.pi/180),r*mt.sin(mt.pi*lat/180)]
def productoPunto(v1,v2):
    resultado=0
    for i in range(3):
        resultado+=v1[i]*v2[i]
    return resultado
def calcularDistancia(p1,p2):
    return mt.pi*r*(180*mt.acos(productoPunto(p1,p2)/(r**2))/mt.pi)/180
